import { Injectable } from '@angular/core';

import { jsPDF } from 'jspdf';
import { ISesion } from '../interfaces/ISesion';

@Injectable({
  providedIn: 'root'
})
export class PdfService {

  constructor() { }  
  
  generatePdf(sesion: ISesion) {
    const doc = new jsPDF();
  
    const logo = 'data:image/png;base64,'; // Logo en base64
  
    // Agregar logo (posición x: 10, y: 10, ancho: 50, alto: 20)
    doc.addImage(logo, 'PNG', 10, 10, 50, 50);
  

    doc.setFontSize(22);
    doc.text('Ticket de Reserva', 70, 50);
  

    doc.setLineWidth(0.5);
    doc.line(10, 60, 200, 60);
  

    doc.setFontSize(12);
    doc.text(`Número de Sesión: ${sesion.sesion_id}`, 10, 70);
    doc.text(`Miembro: ${sesion.miembro}`, 10, 80);
    doc.text(`Entrenador: ${sesion.entrenador}`, 10, 90);
    doc.text(`Especialidad: ${sesion.especialidad}`, 10, 100);
    doc.text(`Fecha: ${sesion.fecha}`, 10, 110);
    doc.text(`Hora Inicio: ${sesion.hora_inicio}`, 10, 120);
    doc.text(`Hora Fin: ${sesion.hora_fin}`, 10, 130);
  

    doc.setFontSize(10);
    doc.text('Gracias por su reserva en el gimnasio.', 10, 150);
  

    doc.save(`Reserva-${sesion.sesion_id}.pdf`);
  }
  
}
